import React, { useState } from 'react';
import { TextField, Button, Box, Container, Typography, MenuItem, Tooltip } from '@mui/material';
import ErrorIcon from '@mui/icons-material/Error';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const securityQuestions = [
  'What was your childhood nickname?',
  'What is the name of your favorite childhood friend?',
  'What was your favorite place to visit as a child?',
  'What was your dream job as a child?',
];

const Register = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    confirmPassword: '',
    securityQuestion: '',
    answer: ''
  });
  const [passwordError, setPasswordError] = useState(false);
  const [generalError, setGeneralError] = useState('');
  const [loginError, setLoginError] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleRegisterSubmit = (event) => {
    event.preventDefault();
    const { username, password, confirmPassword, securityQuestion, answer } = formData;

    setPasswordError(false);
    setGeneralError('');

    if (password !== confirmPassword) {
      setPasswordError(true);
      return;
    }

    axios.post('http://192.168.20.10:8000/api/register/', {
      username: username,
      password: password,
      questions: securityQuestion,
      answer: answer
    })
    .then(function (response) {
      if (response.data.code !== 500) {
        navigate('/pipeline'); // 注册成功后跳转
      } else {
        setGeneralError('Username already exists or another error occurred.');
      }
    })
    .catch(function (error) {
      setGeneralError('An error occurred while submitting your registration. Please try again.');
      console.log(error);
    });
  };

  const handleLoginSubmit = (event) => {
    event.preventDefault();
    const { username, password } = formData;

    setLoginError('');

    if (!username || !password) {
      if (!username) {
        setLoginError('Username is required');
      }
      if (!password) {
        setLoginError('Password is required');
      }
      return;
    }

    axios.post('http://192.168.20.10:8000/api/login/', {
      username: username,
      password: password
    })
    .then(function (response) {
      if (response.data.auth) {
        navigate('/pipeline');
      } else {
        setLoginError(response.data.message || 'Login failed due to server error.');
      }
    })
    .catch(function (error) {
      setLoginError('Login failed due to server error.');
      console.error('Error during login request:', error);
    });
  };

  return (
    <Container component="main" maxWidth="xs">
      <Box sx={{ marginTop: 15, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <Typography component="h1" variant="h5">
          Register
        </Typography>
        {generalError && (
          <Typography color="error" sx={{ mt: 1, mb: 1 }}>
            {generalError}
          </Typography>
        )}
        <Box component="form" onSubmit={handleRegisterSubmit} sx={{ mt: 1 }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="username"
            label="Username"
            name="username"
            autoComplete="username"
            autoFocus
            value={formData.username}
            onChange={handleChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="new-password"
            value={formData.password}
            onChange={handleChange}
            error={passwordError}
          />
          <Box sx={{ display: 'flex', alignItems: 'center', width: '100%' }}>
            <TextField
              margin="normal"
              required
              fullWidth
              name="confirmPassword"
              label="Confirm Password"
              type="password"
              id="confirmPassword"
              autoComplete="new-password"
              value={formData.confirmPassword}
              onChange={handleChange}
              error={passwordError}
            />
            {passwordError && (
              <Tooltip title="Passwords do not match" placement="right">
                <ErrorIcon color="error" sx={{ ml: 1 }} />
              </Tooltip>
            )}
          </Box>
          <TextField
            margin="normal"
            required
            fullWidth
            id="securityQuestion"
            select
            label="Security Question"
            name="securityQuestion"
            autoComplete="security-question"
            value={formData.securityQuestion}
            onChange={handleChange}
          >
            {securityQuestions.map((question, index) => (
              <MenuItem key={index} value={question}>
                {question}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            margin="normal"
            required
            fullWidth
            id="answer"
            label="Answer"
            name="answer"
            autoComplete="answer"
            value={formData.answer}
            onChange={handleChange}
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2, backgroundColor: '#6EA8DD' }}
          >
            Register
          </Button>
        </Box>

        <Typography component="h1" variant="h5" sx={{ mt: 4 }}>
          Login
        </Typography>
        {loginError && (
          <Typography color="error" sx={{ mt: 1, mb: 1 }}>
            {loginError}
          </Typography>
        )}
        <Box component="form" onSubmit={handleLoginSubmit} sx={{ mt: 1 }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="loginUsername"
            label="Username"
            name="username"
            autoComplete="username"
            autoFocus
            value={formData.username}
            onChange={handleChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="loginPassword"
            autoComplete="current-password"
            value={formData.password}
            onChange={handleChange}
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2, backgroundColor: '#6EA8DD' }}
          >
            Login
          </Button>
        </Box>
      </Box>
    </Container>
  );
};

export default Register;
